import React, { useState } from 'react';
import { Button, Modal, Form } from 'react-bootstrap';

const BeasiswaItem = ({ beasiswa, onDetail, onUpdate, onDelete }) => {
  return (
    <div className="card mb-3 p-3 d-flex justify-content-between align-items-center flex-row">
      <div className="d-flex align-items-center gap-3">
        <img
          src={beasiswa.logo}
          alt={beasiswa.nama}
          style={{ width: "50px", height: "50px", objectFit: "contain" }}
        />
        <h5 className="mb-0">{beasiswa.nama}</h5>
      </div>
      <div className="d-flex gap-2">
        <button className="btn btn-info" onClick={onDetail}>Detail</button>
        <button className="btn btn-warning" onClick={onUpdate}>Update</button>
        <button className="btn btn-danger" onClick={onDelete}>Hapus</button>
      </div>
    </div>
  );
};

export default BeasiswaItem;
